import logo from './logo.svg';
import './App.css';
import {
  Route,
  Link,
  Switch
} from 'react-router-dom'

import React, { Component } from 'react';

import Home from './components/Home';
import About from './components/About';
import Messages from './components/Messages';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h1 className="App-title">Welcome to React</h1>
        </header>
        <div className="menu">
        <ul>
          <li> <Link to="/components">Home</Link> </li>
          <li> <Link to="/components/messages">Messages</Link> </li>
          <li> <Link to="/components/about">About</Link> </li>
          <li>
          <a href="/messages">Messages (with a regular anchor element)</a>
          </li>
          </ul>
        </div>
        <div className="App-intro">
          <Switch>
          <Route exact path="/components/home" component={Home}/>
          <Route exact path="/components/messages" component={Messages}/>
          <Route exact path="/components/about" component={About}/>
          </Switch>
        </div>
      </div>
    );
  }
}

export default App;
